import React , {useState} from 'react'


import './navbar.scss';

// import {auth} from '../../firbase'

const Navbar = () => {
    const [linkselected, setLink] = useState(0);
    function changelink(type)
    {
        setLink(type);
    }

  return (
    <div className="navbar-conrtainer">
        <div className="logo">
            <h1>LOGO</h1>
        </div>
        <ul className="pages-list">  
                <li>  <a //onClick={changelink(0)}
                className= {linkselected == 0  ? "link-active" : ""}
                 href="#">HOME
                 </a></li> 
                <li> <a // onClick={setLink(1)}
                className= {linkselected == 1  ? "link-active" : ""} 
                href="#" >ABOUT</a>
                </li>
                <li> <a //onClick={setLink(2)}
                className= {linkselected == 2  ? "link-active" : ""}
                href="#">SERVICE
                </a></li>
                <li> <a //onClick={setLink(3)}
                className= {linkselected == 3  ? "link-active" : ""}
                href="#">CONTACT</a>
            </li>
        </ul>
        <ul className="language-select">
            <li> <a>FR</a> </li>
            <li> <a>ENG</a> </li>
        </ul>
    </div>
  );
};


export default Navbar;
